const isNotArchived = archivedIds => story => archivedIds.indexOf(story.objectID) === -1;

const getLoginData = ({ loginState }) => {
    return (
        loginState
    );
}

const getFetchError = ({ storyState }) => {
    return (
        storyState.error
    );
}

export { getLoginData, getFetchError }
